// src/pages/AdminDashboard.js
import React, { useState } from "react";
import { MapContainer, TileLayer, Marker, Popup, useMapEvents } from "react-leaflet";
import "leaflet/dist/leaflet.css";

export default function AdminDashboard({ isAdmin }) {
  if (!isAdmin) return <h2>Access Denied</h2>;

  const [pois, setPois] = useState([
    { id: 1, name: "Taytay Falls", type: "nature", description: "Beautiful waterfall", visitors: "High", lat: 14.15, lng: 121.47, image: "" },
    { id: 2, name: "Majayjay Church", type: "history", description: "Historic church", visitors: "Very High", lat: 14.14, lng: 121.48, image: "" },
  ]);

  const [selectedPosition, setSelectedPosition] = useState(null);
  const [newPOI, setNewPOI] = useState({ name: "", type: "", description: "", visitors: "Moderate", image: "" });

  // Map click handler
  function MapClickHandler() {
    useMapEvents({
      click(e) {
        setSelectedPosition(e.latlng);
      },
    });
    return null;
  }

  const savePOI = () => {
    if (!newPOI.name || !selectedPosition) {
      alert("Please provide a name and select a location on the map");
      return;
    }
    const poi = {
      ...newPOI,
      id: Date.now(),
      lat: selectedPosition.lat,
      lng: selectedPosition.lng,
    };
    setPois([...pois, poi]);
    setSelectedPosition(null);
    setNewPOI({ name: "", type: "", description: "", visitors: "Moderate", image: "" });
  };

  const deletePOI = (id) => setPois(pois.filter(p => p.id !== id));

  return (
    <div style={{ padding: 20 }}>
      <h1>Admin Dashboard</h1>

      <h2>Add POI</h2>
      <p>Click on the map to select the POI location</p>
      <div style={{ height: "400px", marginBottom: "16px" }}>
        <MapContainer center={[14.1467, 121.4708]} zoom={13} style={{ height: "100%", width: "100%" }}>
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {pois.map(p => (
            <Marker key={p.id} position={[p.lat, p.lng]}>
              <Popup>
                <strong>{p.name}</strong>
                <p>{p.description}</p>
              </Popup>
            </Marker>
          ))}
          {selectedPosition && <Marker position={selectedPosition}><Popup>New POI location</Popup></Marker>}
          <MapClickHandler />
        </MapContainer>
      </div>

      <div style={{ marginBottom: "16px" }}>
        <input type="text" placeholder="Name" value={newPOI.name} onChange={e => setNewPOI({ ...newPOI, name: e.target.value })} />
        <input type="text" placeholder="Type" value={newPOI.type} onChange={e => setNewPOI({ ...newPOI, type: e.target.value })} />
        <input type="text" placeholder="Description" value={newPOI.description} onChange={e => setNewPOI({ ...newPOI, description: e.target.value })} />
        <input type="text" placeholder="Visitors (High/Moderate/Low)" value={newPOI.visitors} onChange={e => setNewPOI({ ...newPOI, visitors: e.target.value })} />
        <input type="text" placeholder="Image URL" value={newPOI.image} onChange={e => setNewPOI({ ...newPOI, image: e.target.value })} />
        <button onClick={savePOI} style={{ display: "block", marginTop: "8px" }}>Save POI</button>
      </div>

      <h2>Existing POIs</h2>
      <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
        <thead>
          <tr><th>ID</th><th>Name</th><th>Type</th><th>Description</th><th>Visitors</th><th>Actions</th></tr>
        </thead>
        <tbody>
          {pois.map(p => (
            <tr key={p.id}>
              <td>{p.id}</td>
              <td>{p.name}</td>
              <td>{p.type}</td>
              <td>{p.description}</td>
              <td>{p.visitors}</td>
              <td><button onClick={() => deletePOI(p.id)}>Delete</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
